import { Link } from "react-router-dom";

function Navbar(){
    return(
        <div className="flex items-center p-3">
            <i class ="fa-brands fa-imdb"></i>
            {/* this is a commetn */}
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/IMDB_Logo_2016.svg/2560px-IMDB_Logo_2016.svg.png" className="h-12 w-30" alt="" />
            <Link to={"/"} className="text-3xl mx-6 font-bold text-yellow-200 hover:cursor-pointer">Movies</Link>
            <Link to={"/watchlist"} className="mx-6 text-3xl font-bold text-white-100 hover:cursor-pointer">WatchList</Link>
        </div>
    )
}

export default Navbar;
